<?php

namespace Tests\Unit;

use App\Models\AkunModel;
use App\Models\BeritaModel;
use Illuminate\Http\UploadedFile;
use Tests\TestCase;

class BeritaTest extends TestCase
{
    public function test_add_berita_gambar_base64()
    {
        $akun = AkunModel::find(1);
        $response = $this->actingAs($akun)->post('/berita/store', [
            'judul' => 'Judul Berita',
            'slug' => 'judul-berita',
            'isi' => '<p>asddassddsaasd</p><p><img src="data:image/jpeg;base64," style="width: 554.887px;" data-filename="073ef7c3-7af5-41b4-8d91-444f11df901b_169.jpeg"><br></p>',
            'tanggal' => now(),
            'gambar' => UploadedFile::fake()->image('gambar.jpg'),
        ]);

        $response->assertSessionHasNoErrors();
        $response->assertStatus(302);
        $response->assertRedirect('/berita');
    }

    public function test_add_berita_tanpa_gambar(): void
    {
        $akun = AkunModel::find(1);
        $response = $this->actingAs($akun)->post('/berita/store', [
            'judul' => 'Judul Berita',
            'slug' => 'berita dengan gambar dari link',
            'isi' => '<p>ini adalah berita yang gambarnya di ambil dari link</p>',
            'tanggal' => now(),
            'gambar' => UploadedFile::fake()->image('gambar.jpg'),
        ]);

        $response->assertSessionHasNoErrors();
        $response->assertStatus(302);
        $response->assertRedirect('/berita');
    }

    public function test_add_berita_gambar_from_link(): void
    {
        $akun = AkunModel::find(1);
        $response = $this->actingAs($akun)->post('/berita/store', [
            'judul' => 'Judul Berita',
            'slug' => 'berita dengan gambar dari link testing',
            'isi' => '<p>ini adalah berita yang gambarnya di ambil dari link <img src="https://wallpapercave.com/wp/wp7802795.jpg" alt=""></p>',
            'tanggal' => now(),
            'gambar' => UploadedFile::fake()->image('gambar.jpg'),
        ]);

        $response->assertSessionHasNoErrors();
        $response->assertStatus(302);
        $response->assertRedirect('/berita');
    }

    public function test_delete_berita(): void
    {
        $akun = AkunModel::find(1);
        $berita = BeritaModel::latest()->first();
        $response = $this->actingAs($akun)->delete('/berita/delete/' . $berita->id_berita);
        $response->assertSessionHasNoErrors();
        $response->assertStatus(302);
        $response->assertRedirect('/berita');
    }

    public function test_set_berita_published(): void
    {
        $akun = AkunModel::find(1);
        $response = $this->actingAs($akun)->post('/berita/status', [
            'id_berita' => 2,
            'status' => 'publish'
        ]);
        $response->assertSessionHasNoErrors();
        // $response->assertStatus(302);
        // $response->assertRedirect('/berita');
    }

    public function test_set_berita_rejected(): void
    {
        $akun = AkunModel::find(1);
        $response = $this->actingAs($akun)->post('/berita/status', [
            'id_berita' => 2,
            'status' => 'reject'
        ]);
        $response->assertSessionHasNoErrors();
        // print session message
        // $response->assertStatus(302);
        // $response->assertRedirect('/berita');
    }
}
